import groovy.json.JsonSlurper



def pipelineParameters =  sdc.pipelineParameters()
def jsonStr = pipelineParameters['ENCRYPTION_DETAILS'].toString().toLowerCase()
def schemaName = pipelineParameters['DESTINATION_SCHEMA'].toString().toLowerCase()
def arrayEncryptedFields =[:]

def list = new JsonSlurper().parseText( jsonStr )




for (record in records) {
	try{
    	list.each {
        	arrayEncryptedFields[it['tablename']]=it['encrypted'].replaceAll(~/^\[|"|'|\]$/, '').split(',')
        	//create table agenecy_details_auto select * from agency_details Limit 0;
        	record.value['SQL_SCRIPT'] = 'create table '+schemaName.toString()+'.'+ it['tablename'] + '_encrypted select * from '+schemaName.toString()+'.'+ it['tablename'] +' LIMIT 0'
        	sdc.output.write(record)
        	sdc.log.info('record.value[\'SQL_SCRIPT\'] ----> '+ record.value['SQL_SCRIPT'])
        	record.value['SQL_SCRIPT'] = 'ALTER TABLE ' +schemaName.toString()+'.'+ it['tablename'] + '_encrypted MODIFY ' + arrayEncryptedFields[it['tablename']].join(' TEXT, MODIFY ') + ' TEXT'
        	sdc.log.info('record.value[\'SQL_SCRIPT\'] ----> '+ record.value['SQL_SCRIPT'])
        	sdc.output.write(record)

    	}
	}
	catch (e){
    	sdc.log.error(e.toString(), e)
    	sdc.error.write(record, e.toString())
	}
}

